function dragElement(elmnt) {
var pos1 = 0, pos2 = 0, pos3 = 0, pos4 = 0;
if (document.getElementById(elmnt.id + "Header")) {
document.getElementById(elmnt.id + "Header").onmousedown = dragMouseDown;
} else {
elmnt.onmousedown = dragMouseDown;
}
function dragMouseDown(e) {
e = e || window.event;
e.preventDefault();
pos3 = e.clientX;
pos4 = e.clientY;
document.onmouseup = closeDragElement;
document.onmousemove = elementDrag;
}
function elementDrag(e) {
e = e || window.event;
e.preventDefault();
const screenWidth = window.innerWidth;
const screenHeight = window.innerHeight;
const windowWidth = elmnt.offsetWidth;
const windowHeight = elmnt.offsetHeight;
pos1 = pos3 - e.clientX;
pos2 = pos4 - e.clientY;
pos3 = e.clientX;
pos4 = e.clientY;
let newX = elmnt.offsetLeft - pos1;
let newY = elmnt.offsetTop - pos2;
newX = Math.max(0, newX);
newX = Math.min(newX, screenWidth - windowWidth);
newY = Math.max(0, newY);
newY = Math.min(newY, screenHeight - windowHeight);
elmnt.style.top = newY + "px";
elmnt.style.left = newX + "px";
}
function closeDragElement() {
document.onmouseup = null;
document.onmousemove = null;
}
}
