function selectAnswer(questionEl, questionType, answer) {
let questionId = questionEl.getAttribute("data");
if (!questionId) {
throw new Error("未找到题目ID");
}
switch (questionType) {
case "单选题": {
let answerInput = questionEl.querySelector(`input#answer${questionId}`);
if (answerInput) {
answerInput.value = answer;
log(`已选择单选题答案: ${answer}`);
} else {
throw new Error(`未找到单选题输入框: answer${questionId}`);
}
break;
}
case "多选题": {
let answerInput = questionEl.querySelector(`input#answer${questionId}`);
if (answerInput) {
answerInput.value = answer.join("");
log(`已选择多选题答案: ${answer.join("")}`);
} else {
throw new Error(`未找到多选题输入框: answer${questionId}`);
}
break;
}
case "判断题": {
let answerInput = questionEl.querySelector(`input#answer${questionId}`);
if (answerInput) {
answerInput.value = answer;
log(`已选择判断题答案: ${answer}`);
} else {
throw new Error(`未找到判断题输入框: answer${questionId}`);
}
break;
}
case "填空题": {
let textareas = questionEl.querySelectorAll('textarea');
for (let textarea of textareas) {
textarea.remove();
}
for (let i = 0; i < answer.length; i++) {
let input = document.createElement('input');
input.name = `answerEditor${questionId}${i + 1}`;
input.value = answer[i];
questionEl.insertBefore(input, questionEl.firstChild);
}
break;
}
case "计算题": {
let textarea = questionEl.querySelector('textarea');
textarea.remove();
let input = document.createElement('input');
input.name = `answer${questionId}`;
input.value = `<p>${answer.join('<br/>')}</p>`;
questionEl.insertBefore(input, questionEl.firstChild);
break;
}
case "简答题": {
let textarea = questionEl.querySelector('textarea');
textarea.remove();
let input = document.createElement('input');
input.name = `answer${questionId}`;
input.value = `<p>${answer.join('<br/>')}</p>`;
questionEl.insertBefore(input, questionEl.firstChild);
break;
}
default:
throw new Error(`不支持的题目类型: ${questionType}`);
}
}
async function processAllQuestions(token) {
let DividerBox = workIframedoc.querySelector('div.DividerBox');
if (DividerBox) {
log("题目已完成，无需重复处理");
return;
}
let questions = workIframedoc.querySelectorAll('div.singleQuesId');
if (!questions || questions.length === 0) {
log("未找到题目");
return;
}
log(`发现 ${questions.length} 道题目，开始逐一处理`);
for (let i = 0; i < questions.length; i++) {
let questionEl = questions[i];
let questionIndex = i + 1;
try {
log(`------ 开始处理第 ${questionIndex}/${questions.length} 题 ------`);
showMessage(`处理第 ${questionIndex}/${questions.length} 题`, `blue`);
let questionId = questionEl.getAttribute("data");
if (!questionId) {
log(`第 ${questionIndex} 题未找到ID，跳过`);
continue;
}
let answerTypeInput = questionEl.querySelector(`span.newZy_TItle`);
if (!answerTypeInput) {
log(`第 ${questionIndex} 题未找到题型，跳过`);
continue;
}
let typeText = answerTypeInput.textContent.substring(1, answerTypeInput.textContent.length - 1);
if (!['单选题', '多选题', '判断题', '填空题', '计算题', '简答题'].includes(typeText)) {
log(`第 ${questionIndex} 题为 ${typeText}，暂不支持，跳过`);
continue;
}
let answerInput = questionEl.querySelector(`input#answer${questionId}`);
if (answerInput && answerInput.getAttribute("value")) {
log(`第 ${questionIndex} 题已作答，跳过`);
continue;
}
log(`正在截图第 ${questionIndex} 题`);
let base64Image = await captureQuestion(questionEl);
if (!base64Image) {
log(`第 ${questionIndex} 题截图失败，跳过`);
continue;
}
let questionInfo = {
type: typeText,
image: base64Image
};
log(`题目类型: ${questionInfo.type}`);
log(`正在请求第 ${questionIndex} 题答案`);
let answer;
if (isUseOwnAi) {
answer = await getAnswerFromOwnAI(questionInfo);
} else {
answer = await getAnswer(token, questionInfo);
}
if (!answer) {
log(`未获取到第 ${questionIndex} 题答案，跳过`);
isAutoSubmit = false;
log(`已关闭自动提交功能`);
continue;
}
log(`获取到答案: ${JSON.stringify(answer)}`);
selectAnswer(questionEl, questionInfo.type, answer);
log(`第 ${questionIndex} 题答题完成`);
await delay(1000);
} catch (err) {
log(`第 ${questionIndex} 题处理失败: ${err.message}，继续处理下一题`);
isAutoSubmit = false;
log(`已关闭自动提交功能`);
}
}
await saveAnswers();
if (isAutoSubmit) {
let btnSubmit = workIframedoc.querySelector('.btnSubmit');
if (btnSubmit) {
log("已点击确认按钮");
btnSubmit.click();
await submitAnswers();
} else {
log("未找到确认按钮");
}
}
}
