function verifyToken(token) {
return new Promise((resolve) => {
GM_xmlhttpRequest({
method: "POST",
url: `${BACKEND_URL}/api/verify-token`,
data: JSON.stringify({ token }),
headers: { "Content-Type": "application/json" },
onload: (res) => {
try {
let data = JSON.parse(res.responseText);
log(`Token验证响应: ${data.msg}`);
if (data.code === 200) {
log(`今日公用token数量还剩：${data.remaining_daily}`);
}
resolve(data.code === 200);
} catch (e) {
log(`Token验证解析错误: ${e.message}`);
resolve(false);
}
},
onerror: (err) => {
log(`Token验证请求错误: ${err.message || '未知错误'}`);
resolve(false);
}
});
});
}
