function captureQuestion(questionEl) {
return new Promise((resolve) => {
let clone = questionEl.cloneNode(true);
clone.style.position = "fixed";
clone.style.top = "0";
clone.style.left = "-9999px";
document.body.appendChild(clone);
html2canvas(clone, {
useCORS: true,
allowTaint: false
}).then(canvas => {
let base64 = canvas.toDataURL("image/png").replace("data:image/png;base64,", "");
document.body.removeChild(clone);
resolve(base64);
}).catch(error => {
log(`截图失败: ${error.message}`);
document.body.removeChild(clone);
resolve(null);
});
});
}
function getAnswer(token, questionInfo) {
return new Promise((resolve, reject) => {
GM_xmlhttpRequest({
method: "POST",
url: `${BACKEND_URL}/api/get-answer`,
data: JSON.stringify({
token,
question_type: questionInfo.type,
question_image: questionInfo.image
}),
headers: { "Content-Type": "application/json" },
onload: (res) => {
try {
let data = JSON.parse(res.responseText);
if (data.code === 200) {
log(`今日公用token数量还剩：${data.remaining_daily}`);
resolve(data.answer);
} else if (data.code === 401) {
log(`${data.msg}`);
resolve(false);
} else if (data.code === 402) {
log(`${data.msg}`);
resolve(false);
} else {
reject(new Error(data.msg));
}
} catch (error) {
reject(new Error(`解析答案失败: ${error.message}`));
}
},
onerror: () => reject(new Error("后端请求失败"))
});
});
}
